import React from 'react';
import './teacherProjects.css';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import ImageRowOne from './scratchImage1';
import ImageRowTwo from './scratchImage2';
import ImageRowThree from './scratchImage3';
import SidePanel from '../components/sideDrawer/sidePanel';
import spacing from '@material-ui/system';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  }
}));

const theme = {
  spacing: 10
}

export default function CenteredGrid(props) {
  const classes = useStyles();

  return (
    <div className="teacher-login">
    <div className={classes.root}>
      <Grid spacing={30}>
      <Grid container spacing={3}>
        <Grid item xs={3}>
          <div className={classes.paper}>row1</div>
          <SidePanel />
        </Grid>
        <Grid item xs={3}>
          <div className={classes.paper}>row2</div>
          <ImageRowOne />
        </Grid>
        <Grid item xs={3}>
          <div className={classes.paper}>row3</div>
          <ImageRowTwo />
        </Grid>
        <Grid item xs={3}>
          <div className={classes.paper}>row4</div>
          <ImageRowThree />
        </Grid>
        </Grid>
      </Grid>
    </div>
    </div>
  );
}
